INSERT INTO `community` VALUES (1,0,'Flipping America - página comunitaria','flipping-america-página-comunitaria','366','<p>&iexcl;Bienvenido a nuestra comunidad!&nbsp;</p>\r\n\r\n<p>&iexcl;Estamos emocionados de tenerte aqu&iacute;! Este es un espacio donde personas con ideas afines se re&uacute;nen para conectarse, compartir ideas y crecer juntos. Nuestro objetivo es fomentar un ambiente positivo, solidario y atractivo donde todos se sientan bienvenidos.</p>\r\n\r\n<p>Esto es lo que necesita saber:</p>\r\n\r\n<p>Reglas de la comunidad<br />\r\nPara que todo sea agradable y respetuoso para todos, le pedimos que siga estas sencillas pautas:</p>\r\n\r\n<p>Sea respetuoso: trate a los dem&aacute;s como le gustar&iacute;a que lo trataran a usted. No se tolerar&aacute; ning&uacute;n comportamiento irrespetuoso u ofensivo.<br />\r\nNo maldecir: mantenga el lenguaje limpio y profesional.<br />\r\nProhibici&oacute;n de solicitudes no autorizadas: no promocione productos, servicios u otras empresas personales sin la aprobaci&oacute;n previa del equipo de administraci&oacute;n.<br />\r\nMant&eacute;ngase en el tema: mantengamos las conversaciones relevantes al tema de esta comunidad.<br />\r\nSin spam: evite publicaciones repetitivas, autopromoci&oacute;n excesiva o contenido irrelevante.<br />\r\nRespete la privacidad: evite compartir informaci&oacute;n privada de otros sin su consentimiento.<br />\r\nSiga las instrucciones de los moderadores: nuestros moderadores est&aacute;n aqu&iacute; para ayudar. Por favor coopere con ellos para mantener la armon&iacute;a en el grupo.</p>\r\n\r\n<p>Estamos encantados de tenerte aqu&iacute; y no podemos esperar a ver las incre&iacute;bles contribuciones que har&aacute;s a esta comunidad. &iexcl;Sigamos siendo inspirador, positivo y acogedor para todos!</p>\r\n\r\n<p>Tu equipo de moderaci&oacute;n.</p>\r\n','1','2024-11-26 07:57:56','1'),(2,0,'Flipping America - página comunitaria - Admin','flipping-america-página-comunitaria-admin','0','<p>&iexcl;Bienvenido a nuestra comunidad!&nbsp;</p>\r\n\r\n<p>&iexcl;Estamos emocionados de tenerte aqu&iacute;! Este es un espacio donde personas con ideas afines se re&uacute;nen para conectarse, compartir ideas y crecer juntos. Nuestro objetivo es fomentar un ambiente positivo, solidario y atractivo donde todos se sientan bienvenidos.</p>\r\n\r\n<p>Esto es lo que necesita saber:</p>\r\n\r\n<p>Reglas de la comunidad<br />\r\nPara que todo sea agradable y respetuoso para todos, le pedimos que siga estas sencillas pautas:</p>\r\n\r\n<p>Sea respetuoso: trate a los dem&aacute;s como le gustar&iacute;a que lo trataran a usted. No se tolerar&aacute; ning&uacute;n comportamiento irrespetuoso u ofensivo.<br />\r\nNo maldecir: mantenga el lenguaje limpio y profesional.<br />\r\nProhibici&oacute;n de solicitudes no autorizadas: no promocione productos, servicios u otras empresas personales sin la aprobaci&oacute;n previa del equipo de administraci&oacute;n.<br />\r\nMant&eacute;ngase en el tema: mantengamos las conversaciones relevantes al tema de esta comunidad.<br />\r\nSin spam: evite publicaciones repetitivas, autopromoci&oacute;n excesiva o contenido irrelevante.<br />\r\nRespete la privacidad: evite compartir informaci&oacute;n privada de otros sin su consentimiento.<br />\r\nSiga las instrucciones de los moderadores: nuestros moderadores est&aacute;n aqu&iacute; para ayudar. Por favor coopere con ellos para mantener la armon&iacute;a en el grupo.</p>\r\n\r\n<p>Estamos encantados de tenerte aqu&iacute; y no podemos esperar a ver las incre&iacute;bles contribuciones que har&aacute;s a esta comunidad. &iexcl;Sigamos siendo inspirador, positivo y acogedor para todos!</p>\r\n\r\n<p>Tu equipo de moderaci&oacute;n</p>\r\n','1','2024-11-26 07:57:56','1');
