r\n\r\n&lt;p&gt;04/21/2025:&amp;nbsp;&lt;a href=&quot;https://us02web.zoom.us/rec/share/G1TUHgkr6nbAg3D23qqxqgasnPcOJBLqu8SoaEL34xpzACtCfa9I3uDrp2bmr9lz.S-_zpHo52YZRH-0h&quot; target=&quot;_blank&quot;&gt;Zoom Call&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;04/23/2025:&amp;nbsp;&lt;a href=&quot;https://us02web.zoom.us/rec/share/nPAtjhhM9QmMaD_hdiNb-eOy-g-1vbjTk8O5ge78hJ_d6Olo6QUD-lDO_NBbd8F3.znZxvN0UMrEPMZ1t&quot; target=&quot;_blank&quot;&gt;Zoom Call&lt;/a&gt;&lt;/p&gt;',1,27,'2024-11-22 03:17:16');
