<p><strong>Introducci&oacute;n:</strong></p>\r\n\r\n	<ul>\r\n		<li>&quot;Hola, mi nombre es [Tu Nombre] y estoy llamando porque he notado su propiedad en [Direcci&oacute;n]. Me preguntaba si estar&iacute;a dispuesto/a a discutir la posibilidad de vender.&quot;</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<p><strong>Establecer Rapport:</strong></p>\r\n\r\n	<ul>\r\n		<li>&quot;Antes que nada, quiero asegurarme de que no lo estoy molestando. &iquest;Es un buen momento para hablar?&quot;</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<p><strong>Explicar Inter&eacute;s:</strong></p>\r\n\r\n	<ul>\r\n		<li>&quot;Me interes&eacute; en su propiedad porque [menciona alguna caracter&iacute;stica espec&iacute;fica, como ubicaci&oacute;n, tama&ntilde;o, etc.]. &iquest;Podr&iacute;a decirme un poco m&aacute;s sobre la propiedad y su situaci&oacute;n actual?&quot;</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<p><strong>Preguntas Abiertas:</strong></p>\r\n\r\n	<ul>\r\n		<li>&quot;&iquest;Cu&aacute;l es su motivaci&oacute;n para vender en este momento? &iquest;Hay algo espec&iacute;fico que est&eacute; buscando lograr con la venta?&quot;</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<p><strong>Escucha Activa:</strong></p>\r\n\r\n	<ul>\r\n		<li>Escucha atentamente las respuestas y haz preguntas de seguimiento seg&uacute;n sea necesario.</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<p><strong>Ofrecer Informaci&oacute;n:</strong></p>\r\n\r\n	<ul>\r\n		<li>&quot;Entiendo que la venta de una propiedad puede ser un proceso importante. Nosotros hemos trabajado con propietarios en situaciones similares antes y hemos ayudado a facilitar el proceso. &iquest;Le gustar&iacute;a saber m&aacute;s sobre c&oacute;mo podr&iacute;amos ayudarle?&quot;</li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<p><strong>Cerrar Cordialmente:</strong></p>\r\n\r\n	<ul>\r\n		<li>&quot;Aprecio que haya tomado el tiempo para hablar conmigo. &iquest;Podr&iacute;a acordar una visita para ver la propiedad y discutir m&aacute;s a fondo c&oacute;mo podr&iacute;amos proceder?&quot;</li>\r\n	</ul>\r\n	</li>\r\n</ol>\r\n\r\n<p>Recuerda adaptar el guion a la situaci&oacute;n espec&iacute;fica y ser genuino en tus interacciones. La autenticidad y el respeto son clave al hablar con los due&ntilde;os.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n',1,'2024-10-15'),(13,NULL,2,2,'Diferencia Entre Un Agente De Bienes Raíces y Un Wholesaler',NULL,'',1,'2024-10-15'),(16,NULL,2,17,'Llamadas En Vivo',NULL,'',1,'2024-10-15'),(17,NULL,2,16,'La Importancia De Los Contratos',NULL,'<p><strong>Importancia de Utilizar Contratos en Bienes Ra&iacute;ces y Wholesaling:</strong></p>\r\n\r\n<p>La importancia de utilizar contratos en bienes ra&iacute;ces y wholesaling radica en establecer t&eacute;rminos claros, delinear responsabilidades y proteger los intereses de todas las partes involucradas. Los contratos son herramientas legales esenciales que brindan seguridad y evitan malentendidos. En el contexto del wholesaling, donde las transacciones a menudo implican la asignaci&oacute;n de derechos contractuales, estos contratos son fundamentales para estructurar acuerdos y garantizar la validez de la cadena de transacciones.</p>\r\n\r\n<p>Ahora, vamos a examinar detalladamente cada uno de los contratos mencionados:</p>\r\n\r\n<ol>\r\n	<li>\r\n	<p><strong>Contrato de Asociaci&oacute;n (JV Contract - Joint Venture Contract):</strong></p>\r\n\r\n	<ul>\r\n		<li><strong>Importancia:</strong>&nbsp;Define la colaboraci&oacute;n entre dos o m&aacute;s partes en una transacci&oacute;n inmobiliaria, estableciendo roles y distribuci&oacute;n de beneficios.</li>\r\n		<li><strong>Ejemplo:</strong>&nbsp;<em>&quot;Este Contrato de Asociaci&oacute;n entre [Nombre del Inversor A] y [Nombre del Inversor B] establece que [Nombre del Inversor A] aportar&aacute; el 60% de los fondos, mientras que [Nombre del Inversor B] gestionar&aacute; la adquisici&oacute;n. Las ganancias se dividir&aacute;n en proporci&oacute;n a las contribuciones de cada parte.&quot;</em></li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<p><strong>Contrato de Cesi&oacute;n (Assignment Contract):</strong></p>\r\n\r\n	<ul>\r\n		<li><strong>Importancia:</strong>&nbsp;Facilita la transferencia de derechos contractuales, permitiendo al wholesaler asignar el contrato a otro comprador sin adquirir la propiedad directamente.</li>\r\n		<li><strong>Ejemplo:</strong>&nbsp;<em>&quot;Mediante este Contrato de Cesi&oacute;n, [Nombre del Wholesaler] transfiere sus derechos en el contrato de compra de [Direcci&oacute;n] a [Nombre del Comprador] por una tarifa de asignaci&oacute;n de $X.&quot;</em></li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<p><strong>Contrato de Acuerdo de Compra (Agreement to Purchase Contract):</strong></p>\r\n\r\n	<ul>\r\n		<li><strong>Importancia:</strong>&nbsp;Detalla los t&eacute;rminos de la compra de una propiedad, incluyendo precio, plazos y condiciones.</li>\r\n		<li><strong>Ejemplo:</strong>&nbsp;<em>&quot;El Contrato de Acuerdo de Compra entre [Nombre del Comprador] y [Nombre del Vendedor] especifica que la propiedad ubicada en [Direcci&oacute;n] se vender&aacute; por $X, con el cierre programado para el [Fecha].&quot;</em></li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<p><strong>Contrato de Liberaci&oacute;n (Release Contract):</strong></p>\r\n\r\n	<ul>\r\n		<li><strong>Importancia:</strong>&nbsp;Se utiliza para liberar a una parte de las obligaciones contractuales despu&eacute;s de cumplir con ciertas condiciones.</li>\r\n		<li><strong>Ejemplo:</strong>&nbsp;<em>&quot;Este Contrato de Liberaci&oacute;n certifica que [Nombre del Acreedor] exonera a [Nombre del Deudor] de todas las obligaciones contractuales despu&eacute;s de recibir el pago completo de la deuda.&quot;</em></li>\r\n	</ul>\r\n	</li>\r\n	<li>\r\n	<p><strong>Contrato G Card para Agentes Inmobiliarios (Realtor G Card Contract):</strong></p>\r\n\r\n	<ul>\r\n		<li><strong>Importancia:</strong>&nbsp;Establece la relaci&oacute;n entre un agente inmobiliario y un inversor, definiendo la compensaci&oacute;n del agente por la venta de propiedades espec&iacute;ficas.</li>\r\n		<li><strong>Ejemplo:</strong>&nbsp;<em>&quot;Con este Contrato G Card, [Nombre del Inversor] y [Nombre del Agente] acuerdan que el agente recibir&aacute; una tarifa del X% por las propiedades vendidas dentro de un per&iacute;odo acordado.&quot;</em></li>\r\n	</ul>\r\n	</li>\r\n</ol>\r\n\r\n<p>Utilizar estos contratos adecuadamente en el contexto del wholesaling ayuda a estructurar y asegurar las transacciones, garantizando que todas las partes est&eacute;n protegidas y se adhieran a los t&eacute;rminos acordados. Es esencial que los contratos sean redactados con precisi&oacute;n y, en caso de duda, se recomienda buscar asesoramiento legal.</p>\r\n',1,'2024-10-15'),(18,NULL,2,12,'Los sistemas',NULL,'',1,'2024-10-15'),(19,NULL,2,10,'Palabras claves 2',NULL,'',1,'2024-10-15'),(20,NULL,2,9,'Palabras Claves Para Bienes Raices',NULL,'',1,'2024-10-15'),(21,NULL,2,1,'Que Es Wholesaling',NULL,'<p>En bienes ra&iacute;ces, el &quot;wholesaling&quot; (venta al por mayor) es una estrategia de inversi&oacute;n que implica encontrar propiedades subvaluadas, obtenerlas bajo contrato y luego vender esos contratos a inversores o compradores interesados antes de cerrar la transacci&oacute;n. El wholesaler act&uacute;a como un intermediario, buscando oportunidades de inversi&oacute;n y ganando dinero mediante la diferencia entre el precio de compra acordado con el vendedor y el precio de venta acordado con el comprador final.</p>\r\n\r\n<p>El proceso de wholesaling generalmente implica tres pasos clave:</p>\r\n\r\n<ol>\r\n	<li>\r\n	<p><strong>Identificaci&oacute;n de Oportunidades:</strong>&nbsp;El wholesaler busca activamente propiedades subvaluadas, a menudo motivadas por situaciones financieras o personales del vendedor.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Obtenci&oacute;n de Contratos:</strong>&nbsp;Una vez identificada una propiedad, el wholesaler negocia y obtiene un contrato de compra con el vendedor. Este contrato le da al wholesaler el derecho de comprar la propiedad a un precio espec&iacute;fico en un per&iacute;odo de tiempo acordado.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>Venta del Contrato:</strong>&nbsp;Con el contrato en mano, el wholesaler busca compradores o inversores interesados en la propiedad. El contrato se vende a estos compradores a un precio m&aacute;s alto, y la diferencia entre el precio de compra y venta constituye la ganancia del wholesaler.</p>\r\n	</li>\r\n</ol>\r\n\r\n<p>El wholesaling es una estrategia que no requiere grandes inversiones de capital, ya que el wholesaler no compra la propiedad directamente, sino que negocia derechos sobre la misma. Es una forma de entrar en el mercado inmobiliario con menor riesgo financiero, pero requiere habilidades de negociaci&oacute;n, conocimiento del mercado y la capacidad de identificar oportunidades rentables.</p>\r\n',1,'2024-10-15'),(22,NULL,2,13,'Virtual Wholesaling',NULL,'',1,'2024-10-15'),(24,NULL,2,24,'documentos',NULL,'<p>&nbsp;</p>\r\n<scribe-shadow id=\"crxjs-ext\" style=\"position: fixed; width: 0px; height: 0px; top: 0px; left: 0px; z-index: 2147483647; overflow: visible; visibility: visible;\"></scribe-shadow>',1,'2024-11-19'),(25,NULL,2,25,'llamadas de coaching',NULL,'',1,'2024-11-22');
